import * as types from '../actions/actionTypes';
import initialState from './initialState';

export default function clientConfig(state = initialState.clientConfig, action) {
  switch (action.type) {
    case types.LOAD_CLIENT_CONFIG_SUCCESS:
      let newState = Object.assign({},state,{
                                    clientInfo:action.clientConfig.clientConfig.clientInfo, 
                                    clientSecurity: action.clientConfig.clientConfig.clientSecurity,
                                    clientData: action.clientConfig.clientConfig.clientData
                                    });
       return newState;     
    default:
      return state;
  }
}
